import React from 'react'
import '../App.css';
import {SidebarData} from './SidebarData'

function Sidebar() {
    return (
        <div className='Sidebar'>{SidebarData.map((val, key)=> {
            return (
                <li></li>
            )
        })}
        </div>
    )
}

export default Sidebar
